import React from 'react';
import SoundTile from './SoundTile';

const BeachPage = () => {
  return (
    <div className="page" style={{ backgroundColor: 'yellow', height: '100vh' }}>
      <SoundTile sound="Waves" />
      <SoundTile sound="Seagulls" />
      <SoundTile sound="Boat" />
      <SoundTile sound="Campfire" />
      <SoundTile sound="Melody" />
    </div>
  );
};

export default BeachPage;
